import React from 'react'
import styles from './Header.module.css'
class Header extends React.Component {
  constructor(props) {
    super(props)
    this.state = 0
  }
  render() {
    return (
      <div>
        <h1>Latest Posts</h1>
        <div className={styles.filter}>
          <img
            alt='Filter Icon'
            src='data:image/png;base64,'
          />
          <h3>Filter by Category</h3>
        </div>
      </div>
    )
  }
}

export default Header
